import React from "react";
import FeedItemMain from "./FeedItemMain";
import FeedItem from "./FeedItem";
class Feed extends React.Component {
  render() {
    return (
      <div>
        <FeedItemMain />
        <FeedItem />
        <FeedItem />
        <FeedItem />
      </div>
    );
  }
}

export default Feed;
